plot_data <- expand.grid(
  x1 = seq(min(data$x1) - 1, max(data$x1) + 1, length.out = 100),
  x2 = seq(min(data$x2) - 1, max(data$x2) + 1, length.out = 100)
)
plot_data$prob <- predict(model, newdata = plot_data, type = "response")

